import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

export default function HomeComponent() {
  return (
    <Router>
      <div>
        <ul>
          <li>
            <Link to="/Perfil">Perfil</Link>
          </li>
          <li>
            <Link to="/NewTask">New Task</Link>
          </li>
          <li>
            <Link to="/dashboard">Dashboard</Link>
          </li>
        </ul>
        <hr />

        <Switch>
          <Route exact path="/Perfil">
            <Perfil />
          </Route>
          <Route path="/NewTask">
            <NewTask />
          </Route>
          <Route path="/dashboard">
            <Dashboard />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

function Perfil() {
  return (
    <div>
      <h2>Perfil</h2>
    </div>
  );
}

function NewTask() {
  return (
    <div>
      <h2>New Task</h2>
    </div>
  );
}

function Dashboard() {
  return (
    <div>
      <h2>Dashboard</h2>
    </div>
  );
}
